import React from "react";
import blogs from "./Blogs";
import EachBlog from "./Eachblog";
function createBlog(blog) {
  return (
    <div>
      <EachBlog
        key={blog.id}
        img={blog.image}
        date={blog.date}
        bHeading={blog.bHeading}
      />
    </div>
  );
}

function App() {
  return <div>{blogs.map(createBlog)}</div>;
}

export default App;
